import { useEffect, useState } from "react";
import axios from "axios";
import { useSelector } from "react-redux";

export const History = () => {
    const [data, setData ] = useState('');
    const user = useSelector(state => state.reducer[0]); 
    console
    useEffect(() => {
    async  function getData () {
        let getTransactionDetails = await axios.get(`https://localhost:44322/Transaction/transaction_receipts?accountNumber=${user.accountNumber}`).then(response => console.log(response)).catch(err => console.log(err, 'error caught during post of account number '));

    }
    getData();
    }, [])
    return (<>
        div works!
    </>);
}
